def elapsed_seconds(start, end):
    start = str(start).replace('-', ' ').replace(':', ' ').split(' ')
    end = str(end).replace('-', ' ').replace(':', ' ').split(' ')
    res = [ int(end[i]) - int(start[i]) for i in range(6) ]
    return res[2] * 86400 + res[3] * 3600 + res[4] * 60 + res[5]

def elapsed_seconds(s, e):
    ls = (str(e - s).split(':'))
    return int(ls[0]) * 3600 + int(ls[1]) * 60 + int(ls[2])

import datetime
import time

def elapsed_seconds(start, end):
    start = datetime.datetime.timetuple(start)
    end  = datetime.datetime.timetuple(end)
    start = time.mktime(start)
    end  = time.mktime(end)
    return int(end - start)

